THE ALEX JONES SHOW
2009.11.24 Tuesday

Join the Resistance! Join the Revolution!

Alex talks with Dr. Tim Ball, retired professor, climatologist, and leader of the Natural Resources Stewardship Project, Darrel Rundus, Christian businessman and founder of The Great News Network, who will be in-studio, and Marc Morano, who runs the ClimateDepot website for the Committee for a Constructive Tomorrow. Alex covers the latest on the CRU climategate, runs down the news, and takes your calls.

HOUR 1: Global eugenics climate cult, earth is actually cooling since 1961,
media clip on blood samples from babies born in hospitals (what happens to 
the blood?), the State keeps you and your baby's blood taken at hospitals,
MARC MORANO, al gore the liar, et cetera

HOUR 2: global warming hoax leak, Earth being chem trailed, water being poisoned,
take your local government back, stop the establishment's brain washing and
fraud, big money funds both sides of a debate like a don king fight, AJ interview
clip regarding obama campaign promises, war has been expanded, obama is only sock
puppet for anglo american empire, said he was going to bring the big banks to 
justice, obama has spent more mony than all presidents before him - combined!, 
this is a mass looting, American tax payers ended up being the muscle for the
global elite, have a REVOLUTION OF IDEAS and peaceful rebellion, resistance is
victory, preserve and uphold freedom of speech, Ted Anderson, Montana residents
petitioned for gold and silver backed currency - started pressing their own
coinage, more Marc Morano, prosecute the real climate criminals, head of E.U. calls
for orwellian global governance (with G20) from copenhagen treaty...

HOUR 3: TIM BALL, no pleasure in &quot;I told you so&quot; but need to hold the criminals
accountable, just tip of the iceberg, tyrannical global government, carbon credit
rationing, all the big money is behind global warming hoax with government 
complicity who wants to tax you out of existence, etc.

HOUR 4: More Tim Ball, copenhagen carbon tax shamanism, DARREL RUNDUS, fight
evil, Tyranny USA, is this land of the free - home of the brave or what?!, 
Open Lines with Darrel Rundus, several Canadian callers past two days, etc.

HOUR 5: (14 min) Overdrive with Darrel Rundus, Mr. Rundus gives open Prayer, 
Open Lines, Charlie Sheen video contest update, etc.


